import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Outlet, useNavigate } from 'react-router-dom';
import Page from './Page';

function Home() {
    const navigate = useNavigate();

    const handleXDButtonClick = () => {
        // Używamy `navigate` do przekierowania do trasy "/xd"
        navigate('/xd');
    };

    const handleStrona2ButtonClick = () => {
        // Używamy `navigate` do przekierowania do trasy "/strona2"
        navigate('/strona2');
    };

    return (
        <div>
            <button onClick={handleXDButtonClick}>Przejdź do XD</button>
            <button onClick={handleStrona2ButtonClick}>Przejdź do Strona 2</button>
        </div>
    );
}


function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/xd" element={<Page>XDDD</Page>} />
                <Route path="/strona2" element={<Page>Strona 2</Page>} />
            </Routes>
        </Router>
    );
}


export default App;
